function Position({name, triggers, counter}) {
    return (
        <>
            <p>{name}</p>
            <h3>Position</h3>
            {console.log("pos"+ triggers)}
            <p>X: {triggers[counter]?.Position[0]}</p>
            <p>Y: {triggers[counter]?.Position[1]}</p>
            <p>Z: {triggers[counter]?.Position[2]}</p>
        </>
    );
}

export default Position;
